import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from '../Components/Home/Home';

const Router = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/' component={Home} />
            </Switch>
        </BrowserRouter>
    );
};

export default Router;
